// src/components/ServicePage.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';

function ServicePage() {
  const [service, setService] = useState({});
  const [quantity, setQuantity] = useState(1);
  const [location, setLocation] = useState('');
  const [additionalInfo, setAdditionalInfo] = useState('');
  const { serviceId } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    const fetchService = async () => {
      try {
        const res = await axios.get(`/student/services/${serviceId}`, {
          headers: { Authorization: localStorage.getItem('token') },
        });
        setService(res.data);
      } catch (err) {
        alert('Error fetching service details');
      }
    };
    fetchService();
  }, [serviceId]);

  const placeOrder = async () => {
    try {
      await axios.post(
        '/student/orders',
        { serviceId: service.id, quantity, location, additionalInfo },
        { headers: { Authorization: localStorage.getItem('token') } }
      );
      alert('Thank you for your order!');
      navigate('/student/orders');
    } catch (err) {
      alert(err.response?.data?.error || 'An error occurred while placing the order');
    }
  };

  return (
    <div style={styles.card}>
      <h2 style={styles.title}>{service.name}</h2>
      <p style={styles.description}>{service.description}</p>
      <div style={styles.table}>
        <div style={styles.row}>
          <label style={styles.label}>Quantity:</label>
          <input
            type="number"
            value={quantity}
            min="1"
            onChange={(e) => setQuantity(e.target.value)}
            style={styles.input}
          />
        </div>
        <div style={styles.row}>
          <label style={styles.label}>Location:</label>
          <input
            type="text"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            placeholder="Enter delivery location"
            style={styles.input}
          />
        </div>
        <div style={styles.row}>
          <label style={styles.label}>Additional Information:</label>
          <textarea
            value={additionalInfo}
            onChange={(e) => setAdditionalInfo(e.target.value)}
            placeholder="Any additional instructions?"
            style={styles.textarea}
          />
        </div>
      </div>
      <button onClick={placeOrder} style={styles.orderButton}>Place Order</button>
    </div>
  );
}

const styles = {
  card: {
    maxWidth: '600px',
    margin: 'auto',
    padding: '20px',
    backgroundColor: '#f9f9f9',
    borderRadius: '8px',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    fontSize: '24px',
    marginBottom: '15px',
    color: '#333',
  },
  description: {
    fontSize: '16px',
    color: '#555',
    marginBottom: '20px',
  },
  table: {
    display: 'table',
    width: '100%',
    borderCollapse: 'separate',
    borderSpacing: '0 10px',
  },
  row: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '8px 0',
  },
  label: {
    flex: '1',
    fontSize: '16px',
    color: '#333',
  },
  input: {
    flex: '2',
    padding: '8px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    fontSize: '16px',
  },
  textarea: {
    flex: '2',
    padding: '8px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    fontSize: '16px',
    resize: 'vertical',
  },
  orderButton: {
    width: '100%',
    padding: '12px',
    fontSize: '16px',
    color: '#fff',
    backgroundColor: '#4CAF50',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
    marginTop: '20px',
  },
};

export default ServicePage;
